import React, { Component } from 'react';
import { Container } from 'react-bootstrap';
import './App.css';
import Search from "./components/search/search.js";

class App extends Component {
  render() {
    return (
      <Container className="App">
        <div className="App-header">
          <h2>Google Books</h2> <img href="https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwjhtt_KgeziAhVJSN8KHZjzBTcQjRx6BAgBEAU&url=http%3A%2F%2Fwww.bradleysbookoutlet.com%2F&psig=AOvVaw2qHnSjLQcT96fPWuWNU4Fh&ust=1560706127478445" />
        </div>
        <div className="App-intro">
          <Search />
        </div>
      </Container>
    );
  }
}

export default App;
